import React from 'react';
import ReactDOM from 'react-dom';
import './style.scss';
import App from './App';
import * as serviceWorker from './serviceWorker';

// ReactDOM.render(<App />, document.getElementById('root'));

if (module.hot) {
    module.hot.accept('./index', () => {
      ReactDOM.render(<App/>, document.getElementById('root'));
    });
  }

serviceWorker.unregister();
